import React, { Suspense } from 'react';
import { Canvas } from "@react-three/fiber";
import "./style.css";
import { OrbitControls, PerspectiveCamera } from '@react-three/drei';

function CarShow() {
 return (
  <>
    <OrbitControls />
    <PerspectiveCamera />

    <mesh>
      <boxGeometry />
      <meshBasicMaterial />
    </mesh>
  </>
 );
}

function App() {
  return (
    <Suspense fallback={null}>
      <Canvas shadows>
        <CarShow />
      </Canvas>
    </Suspense>
  );
}

export default App;
